":null},"errorSummary":null,"error":null,"workflows":[],"startTime":1.488266588587E12,"submitTime":1.488266582052E12,"finishTime":1.488266591135E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"269fc6d5-dc38-48a9-85b0-f8370c69eed2"},{"version":"CommandV1","origId":592436977434294,"guid":"74b46e5a-3261-4ef1-b232-937404deb07a","subtype":"command","commandType":"auto","position":2.5625,"command":"%md\n##Handle missing values\n\nHandling missing values is a crucial part in feature engineering when working with data. There are many approaches to this issue, and we should defenitely try to avoid removing complete rows or columns from the dataset, due to the dataset size. We will try to impute missing values based on data distribution and prediction.\nIn this notebook we will go through the taken steps in handling missing values in Titanic Dataset. The following features with missing values were imputed in the dataset:\n* Age\n* Embarked\n* Fare  \nThe features _ticket, cabin, boat, body and home\\_destination_ will be unfortanutely removed from the dataset, since they contain many missing data fields, and imputing these values can give us false information based on the dataset size. So we are making a tough decision to work without these features.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"723ca892-5887-4165-98b2-6db2b4819ce9"},{"version":"CommandV1","origId":2620379507544992,"guid":"7898a989-8248-4d77-8b5e-3fea50d230aa","subtype":"command","commandType":"auto","position":2.75,"command":"%md\n####Impute AGE\nFirst column that we will deal with is _age_. Titanic Dataset is a very well known Kaggle competition, and many people have provided very clever and interesting ideas to deal with the dataset. While dealing with missing values, we will use ideas shared by [Megan L. Risdal on Kaggle](https://www.kaggle.io/svf/924638/c05c7b2409e224c760cdfb527a8dcfc4/__results__.html), since this approach is quite interesting.\nSince the dataset is small in size, we will do the age imputation in R, using [Mice](https://cran.r-project.org/web/packages/mice/index.html) package. We will impute missing age values without some of the columns that give us less useful information. The code for the R script is available in a file _ageImputation.R_.<br>\nAfter running the code, we can compare the distribution of the age column before and after the imputation, just to make sure that we are not making any bad decisions:\n![Alt text](http://www.swiftpic.org/image.uploads/26-02-2017/original-8579452ad555b4ea57b9a155b38170ac.png)\n\nAfter making sure the distribution will be the same after imutation phase, we can impute the missing age values.<br>","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"6814e751-b5f8-4dc9-a645-287087706987"},{"version":"CommandV1","origId":2620379507544993,"guid":"44f72ee2-e128-447d-beb7-6606ce821fe9","subtype":"command","commandType":"auto","position":2.78125,"command":"%md\n### Impute Embarked\nBased on some general ideas on the columns of the Titanic Dataset, prior knowledge and provided information, we can assume that _fare_ and _passenger class_ information can help us retrieve the missing embarkment information. From the dataset, we can see that both passengers that are missing embarkment information paid  $80 for the travel and that they belong to the pclass=1.\nWe can plot the information from which place other travelers with the same pclass and fare values usually embarked. The code for plotting the chart is available in a script _embarkedImputation.R_.\n![Alt text](http://www.swiftpic.org/image.uploads/26-02-2017/original-501bfc4a379d8bef96604e36961ace11.png)\n<br>As we can see from the chart, other passengers that paid $80 (median fare) and belong to pclass=1 usually embarked from 'C'. Based on this information we can impute our missing values with for embarkment with 'C'. ","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"2e1a473a-de15-4d5a-aa37-0b805f532655"},{"version":"CommandV1","origId":2620379507544994,"guid":"ef34f4cd-f71e-4b8d-b820-d60bd7679e2c","subtype":"command","commandType":"auto","position":2.8125,"command":"%md\n### Impute Fare\nThe final column with the missing value that we are going to deal with is _fare_ information. The passenger that is missing this information belongs to the third class, and embarked in 'S'. We can plot the median and distirbution of the _fare_ feature for the passengers that are from the same class and departed from the same place. (The R code is available in a script _fareImputation.R_) <br>\n![Alt text](http://www.swiftpic.org/image.uploads/26-02-2017/original-be2bcfd754f9b598aa2b80c840090a41.png) <br>\nIt seems reasonable based on the plot to replace the missing _fare_ value with median for their class and embarkment, which is $8.05.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"bedce0f1-4334-4494-ad74-d69e24170707"},{"version":"CommandV1","origId":592436977434296,"guid":"2a52ef77-20ef-4742-bc12-4a16cb073631","subtype":"command","commandType":"auto","position":2.828125,"command":"%md\nAfter dealing with the missing data in R, we are reading a final dataset, which contains all the imputed values.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"wo ":"773565aa-121c-49ec-8b6b-a47223b8ea62","subtype":"command","commandType":"auto","position":18.5,"command":"%md\nAfter comparing the results of four tested models, we can see that we are getting quite satisfying results with Random Forest, even for the small number of trees. Random Forest is performing much better than the other tested algorithms. In that manner, we will try to select only the most relevant features, and try to lower the dimensionality of the problem. <br>\nAfter evaluating the results of Random Forest, we have identified the importance of the used features:  \nSparseVector(17, {0: 0.0589, 1: 0.0454, 2: 0.028, 3: 0.0834, 4: 0.1145, 5: 0.0469, 6: 0.0257, 7: 0.019, 8: 0.0159, 9: 0.003, 10: 0.0059, 11: 0.0009, 12: 0.0524, 13: 0.0211, 14: 0.0021, 15: 0.2103, 16: 0.2664}).<br>  \nHere we are going to lower the dimensionality of the problem based on feature importance, and using Vector Slicer Feature Selecion. Let's test how our datasets behave with less features, and try to make more robust model while using smaller number of features.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"874366f6-da96-4985-8cf1-ebb84b7e4f48"},{"version":"CommandV1","origId":592436977434289,"guid":"cddfd145-53be-43ff-9e87-d29432a19bac","subtype":"command","commandType":"auto","position":19.0,"command":"from pyspark.ml.feature import VectorSlicer\nfrom pyspark.ml.linalg import Vectors\nfrom pyspark.sql.types import Row\n\nslicer = VectorSlicer(inputCol=\"features\", outputCol=\"selectedFeatures\").setIndices([3, 4, 15, 16])\n\n# We are using the same datasets as for the other algorithms\noutput = slicer.transform(transformed)\notestData = slicer.transform(testData)\notrainData = slicer.transform(trainingData)\n\n# Let's make our model\nrf = RandomForestClassifier(labelCol=\"label\", featuresCol=\"selectedFeatures\", numTrees=10)\n\n\n# Chain indexers and forest in a Pipeline\npipeline = Pipeline(stages=[labelIndexer, rf])\n\n# Train model.  This also runs the indexers.\nmodel = pipeline.fit(otrainData)\n\n# Make predictions.\npredictions = model.transform(otestData)\n\n# Select example rows to display.\n# display(predictions.select(\"prediction\", \"label\", \"features\"))\n\n# # Select (prediction, true label) and compute test error\nevaluator = BinaryClassificationEvaluator(\n    labelCol=\"label\", rawPredictionCol=\"rawPrediction\", metricName=\"areaUnderROC\")\nareaUnderROC = evaluator.evaluate(predictions)\nprint(\"Area under ROC = %g\" % (areaUnderROC))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Area under ROC = 0.823243\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.488267075029E12,"submitTime":1.488267075021E12,"finishTime":1.488267081464E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"20b6f351-324e-4db2-b294-724cf7ad0ae7"},{"version":"CommandV1","origId":749062160449830,"guid":"45b742a6-0c0a-4e7d-85d3-f728ff4301c0","subtype":"command","commandType":"auto","position":19.5,"command":"%md We have selected 4 of the most predictive features, and the results are better than results of other algorthms. <br>\nLet's see will the performance grow significantly if we add one more feature.","commandVersion":0,"state":"error","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"03a935d6-0c70-4798-a4c4-cd4ffd664e77"},{"version":"CommandV1","origId":592436977434321,"guid":"960451bf-b194-45c2-b78c-3fc5e4dd13f7","subtype":"command","commandType":"auto","position":20.0,"command":"from pyspark.ml.feature import VectorSlicer\nfrom pyspark.ml.linalg import Vectors\nfrom pyspark.sql.types import Row\n\n# slicer = VectorSlicer(inputCol=\"features\", outputCol=\"selectedFeatures\").setIndices([3, 4, 15, 16])\nslicer = VectorSlicer(inputCol=\"features\", outputCol=\"selectedFeatures\").setIndices([0, 3, 4, 15, 16])\n\noutput = slicer.transform(transformed)\notestData = slicer.transform(testData)\notrainData = slicer.transform(trainingData)\n\n# display(output)\n# train, test = output.randomSplit([0.7, 0.3])\n# display(train)\nrf = RandomForestClassifier(labelCol=\"label\", featuresCol=\"selectedFeatures\", numTrees=10)\n\n# Convert indexed labels back to original labels.\n# labelConverter = IndexToString(inputCol=\"prediction\", outputCol=\"predictedLabel\",\n#                                labels=labelIndexer.labels)\n\n# Chain indexers and forest in a Pipeline\npipeline = Pipeline(stages=[labelIndexer, rf])\n\n# Train model.  This also runs the indexers.\nmodel = pipeline.fit(otrainData)\n\n# Make predictions.\npredictions = model.transform(otestData)\n\n# Select example rows to display.\n# display(predictions.select(\"prediction\", \"label\", \"features\"))\n\n# # Select (prediction, true label) and compute test error\nevaluator = BinaryClassificationEvaluator(\n    labelCol=\"label\", rawPredictionCol=\"rawPrediction\", metricName=\"areaUnderROC\")\nareaUnderROC = evaluator.evaluate(predictions)\nprint(\"Area under ROC = %g\" % (areaUnderROC))","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Area under ROC = 0.86754\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1.48826716528E12,"submitTime":1.488267165149E12,"finishTime":1.488267173045E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"1de90859-8f40-4ee5-a38c-504c3e985d87"},{"version":"CommandV1","origId":592436977434322,"guid":"0a380278-bcef-4038-8731-1fcccfe4d9b2","subtype":"command","commandType":"auto","position":21.0,"command":"%md\nOur results from Random Forest with reduced number of dimensions to 5 shows almost the same performance as our model trained on all the 17 features (Area under ROC with 17 features was 0.869552, and we have managed to achieve Area under ROC of 0.86754 while using only 5 of the most predictive features).\n### Final Conclusion\nIn this notebook we have analyzed Titanic Dataset, and modeled the factors that are related to a passenger surviving the crash. <br>\nIn exploratory phase we have used R to impute the missing values, and explain our variables. <br><br>\nFor the purpose of Predictive Modeling, we have tried various classification approaches available in Spark 2.1 ML Library. Random Forest algorithm showed best performance, so we have decided to keep it as our predictive model for this purpose. We have decided to use Area under ROC curve as our metric for model performance, which shows us the power of the model to make a distinction betweeen two groups.<br>\nAfter model exploration and model selection, we were dealing with model robustness. We have managed to represent predictive model with 5 dimensions instead of 17 that we have started with, and keep the model performance. <br>\nDeployed model is scalable and robust, and it can easily work with significantly larger datasets (although the dataset for this problem can not grow significantly).<br><br>\nSome possible improvements for the model might include creating more features from the original dataset, and trying to impute the other missing values or retrieve relevant information from these fields. \n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"ac4760d1-2a3a-45c2-8f2e-33ab90e024f0"}],"dashboards":[],"guid":"168dae37-ba2f-4b0c-b9ec-12b7f26a800b","globalVars":{},"iPythonMetadata":null,"inputWidgets":{}};</script>
